import React from "react";
import './style.css';
import 'semantic-ui-css/semantic.min.css';
import { Header, Container, Segment } from 'semantic-ui-react';

class　Who extends React.Component {
  render() {
    return (
        <Container fluid>
        <div className='who'>
          <Header as = 'h1' textAlign='centered'>WHO IS HIRO?</Header>
        </div>
        <Segment>
          <Segment inverted color = 'teal'><Header as = 'h2'>自己紹介</Header></Segment>
        </Segment>

        </Container>
    );
  }
}

export default Who;
